import React, { Component } from "react";
import { Section, StyledButton } from "../Components";

class Homepage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div>
          <Section primary>
            <div
              style={{ fontSize: "3em", fontWeight: "bold" }}
            >{`We <3 people who code`}</div>
            <div
              style={{
                fontSize: "1.3em",
                maxWidth: "350px",
                textAlign: "center",
                margin: "2%",
              }}
            >
              We build products that empower developers and connect them to
              solutions that enable productivity, growth, and discovery.
            </div>
            <div style={{ display: "flex", flexDirection: "row", flex: 1 }}>
              <StyledButton background={"#fff"} color={"orange"}>
                {" "}
                For Developers
              </StyledButton>
            </div>
            <div>
              <StyledButton background={"orange"} color={"#fff"}>
                {" "}
                For Buisness
              </StyledButton>
            </div>
          </Section>
        </div>
      </>
    );
  }
}

export default Homepage;
